import InnerTile from "./InnerTile"

const data = [
    { id: 1, title: "A" },
    { id: 2, title: "B" },
    { id: 3, title: "C" },
    { id: 4, title: "D" },
]

function ClassPrac() {
    return (
        <div>
            {data.map((item) => {
                return <InnerTile key={item.id} data={item.title}/>
            })}
        </div>
    )
}
export default ClassPrac
